function draw2DLine(p1,p2,color,width) {
  if (p1 === null | p2 === null) {return;}
  let scale = (maxX > maxY) ? 0.3 * maxY : 0.3 * maxX;
  // let scale = 100;
  renderer.x = p1[0]*scale;
  renderer.y = p1[1]*scale;
  renderer.pointTowards(p2[0]*scale,p2[1]*scale);
  renderer.penColor = color;
  renderer.penWidth = width;
  renderer.penDown();
  renderer.move(sqrt((pow(p2[0]*scale-p1[0]*scale,2)) + (pow(p2[1]*scale-p1[1]*scale,2))));
  renderer.penUp();
}

