function mult3x3_3x4Mats(m1, m2) {
  let mOut = [
                (m1[0] * m2[0][0]) + (m1[1] * m2[1][0]) + (m1[2] * m2[2][0]) + (m2[3][0]),
                (m1[0] * m2[0][1]) + (m1[1] * m2[1][1]) + (m1[2] * m2[2][1]) + (m2[3][1]),
                (m1[0] * m2[0][2]) + (m1[1] * m2[1][2]) + (m1[2] * m2[2][2]) + (m2[3][2]),
                (m1[0] * m2[0][3]) + (m1[1] * m2[1][3]) + (m1[2] * m2[2][3]) + (m2[3][3])
  ];
  
  if (mOut[3] !== 0) {
    mOut[0] /= mOut[3];
    mOut[1] /= mOut[3];
    mOut[2] /= mOut[3];
  }
  
  return [mOut[0],mOut[1]];

}

function mult3x3Mats(m1, m2) {
  let mOut = [
                (m1[0] * m2[0][0]) + (m1[1] * m2[1][0]) + (m1[2] * m2[2][0]),
                (m1[0] * m2[0][1]) + (m1[1] * m2[1][1]) + (m1[2] * m2[2][1]),
                (m1[0] * m2[0][2]) + (m1[1] * m2[1][2]) + (m1[2] * m2[2][2])
  ];
  
  return [mOut[0],mOut[1]];

}

