function transformByCam(p) {
    return vec3d.sub(p, camPos);
}

function rotateAroundPoint(p,r,a) {
    let matRotX = mat4x4.makeRotX(r.x);
    let matRotY = mat4x4.makeRotY(r.y);
    let matRotZ = mat4x4.makeRotZ(r.z);
    return mat4x4.multVec(matRotX, mat4x4.multVec(matRotY, mat4x4.multVec(matRotZ, vec3d.sub(p, a))));
}

function doMathyWithTriangle(triangle, rot, scle) {
  
  let tri = [...triangle];
  
  for (let i = 0; i <= 2; i++) {
    tri[i] = transformByCam(rotateAroundPoint(rotateAroundPoint(vec3d.mul(tri[i], scle), rot, new vec3d()),camRot,camPos));
  }
  
  // Save for later
  let tri2 = [...tri];
  
  let line1 = new vec3d();
  let line2 = new vec3d();
  let normal = new vec3d();
  
  line1 = vec3d.sub(tri[1], tri[0]);
  line2 = vec3d.sub(tri[2], tri[0]);
  
  normal = vec3d.crossProduct(line1, line2);
  
  normal = vec3d.normalize(normal);
  
  // Is triangle visible?
  if (vec3d.dotProduct(normal, tri[0]) < 0) {
    
    //Calculate Crude Lighting
    
    let dp = Math.max(0.1, vec3d.dotProduct(lightVec, normal));
    
    for (let i = 0; i <= 2; i++) {
      tri[i] = vec3d.toVec2d(vec3d.normalize(mat4x4.multVec(matProj, tri[i])));
    }
  
    triComp.push([tri2[0],tri2[1],tri2[2],tri[0],tri[1],tri[2],dp]);
  }
}

