function fill_triangle(tri,color,freq,w) {
  //get length of all sides
  
  let x1 = tri[0].x;
  let y1 = tri[0].y;
  let x2 = tri[1].x;
  let y2 = tri[1].y;
  let x3 = tri[2].x;
  let y3 = tri[2].y;
  
  let d1 = sqrt(pow(y2-y1,2)+pow(x2-x1,2));
  let d2 = sqrt(pow(y3-y2,2)+pow(x3-x2,2));
  let d3 = sqrt(pow(y1-y3,2)+pow(x1-x3,2));
  
  if((d1<=d2)&&(d1<=d3)) {//the first side is the shortest
    let tx = x1;
    let ty = y1;
    let vx = (x2-x1)/d1/freq;
    let vy = (y2-y1)/d1/freq;
    for (i = 0; i < d1*freq; i++) {
      draw2DLine([x3,y3],[tx,ty],color,w);
      //drawing a line from point(x3,y3) to point(tx,ty).
      tx = tx + vx;
      ty = ty + vy;
    }
    
  } else if ((d2<=d3)&&(d2<=d1)) {//the second side is the shortest
    let tx = x2;
    let ty = y2;
    let vx = (x3-x2)/d2/freq;
    let vy = (y3-y2)/d2/freq;
    for (i = 0; i < d2*freq; i++) {
        draw2DLine([x1,y1],[tx,ty],color,w);
        tx = tx + vx;
        ty = ty + vy;
    }
  } else {// the third side is shortest
    let tx = x3;
    let ty = y3;
    let vx = (x1-x3)/d3/freq;
    let vy = (y1-y3)/d3/freq;
    for (i = 0; i < d3*freq; i++) {
        draw2DLine([x2,y2],[tx,ty],color,w)
        tx = tx + vx;
        ty = ty + vy;
    }
  }
      
}

