let matRotX = new mat4x4();
let matRotY = new mat4x4();
let matRotZ = new mat4x4();

forever(() => {
  
    FPS = 1/timer();

    resetTimer();
  
    clearPen();

    //Spin model
    // rot.z += 6.4;

    matRotX = mat4x4.makeRotX(rot.x);
    matRotY = mat4x4.makeRotY(rot.y);
    matRotZ = mat4x4.makeRotZ(rot.z);

    //Draw Triangles
    for (let x = 0; model.length > x; x++) {
        
        doMathyWithTriangle(model[x], rot, 10);
      
    }
  
    //Sort triangles back to front
  
    triComp.sort((a,b) => {
      
        let za = (a[0].z + a[1].z + a[2].z) / 3;
        let zb = (b[0].z + b[1].z + b[2].z) / 3;

        if (za > zb) {
            return -1;
        } else if (za < zb) {
            return 1;
        } else {
            return 0;
        }

    })
  
    for (var i = 0; i < triComp.length; i++) {
      
      trisToDraw[i] = [triComp[i][3],triComp[i][4],triComp[i][5]];
      dps[i] = triComp[i][6];
      
    }

    triComp = [];
  
    //Draw Triangles
    for (let x = 0; trisToDraw.length > x; x++) {
        if (trisToDraw[x] === undefined) {break;}
        fill_triangle(trisToDraw[x],rgb(dps[x]*200,dps[x]*200,dps[x]*200),30,3);
        // drawTri(trisToDraw[x],rgb(dps[x]*255,dps[x]*255,dps[x]*255),5);
      
    }
  
    //Movement
    camVel.z += keysDown.includes('W') ? speed * cos(camRot.y) : 0;
    camVel.z += keysDown.includes('S') ? -speed * cos(camRot.y) : 0;
    camVel.x += keysDown.includes('W') ? -speed * sin(camRot.y) : 0;
    camVel.x += keysDown.includes('S') ? speed * sin(camRot.y) : 0;

    camVel.x += keysDown.includes('A') ? -speed * cos(camRot.y) : 0;
    camVel.x += keysDown.includes('D') ? speed * cos(camRot.y) : 0;
    camVel.z += keysDown.includes('A') ? -speed * sin(camRot.y) : 0;
    camVel.z += keysDown.includes('D') ? speed * sin(camRot.y) : 0;

    camVel.y = keysDown.includes('SPACE') ? speed*2 : camVel.y;
    camVel.y = keysDown.includes('SHIFT') ? -speed*2 : camVel.y;
    
    camPos.x += camVel.x;
    camPos.y += camVel.y;
    camPos.z += camVel.z;

    camVel.x *= 0.9;
    camVel.y = 0;
    camVel.z *= 0.9;

    if (!(abs(camRot.x - movementY/3) > 90)) {
      camRot.x -= movementY/3;
    }

    camRot.y -= movementX/3;

    movementX = 0
    movementY = 0

    trisToDraw = [];
    dps = [];
    triComp = [];

})




