let whi = 0;

var FPSArray = [];
var FPSAvrge = 0;

every(100, 'milisecond', () => {
  
  if (whi <= 10) {
    FPSArray[whi] = FPS;
  } else {
    FPSArray[whi] = FPS;
    whi = 0;
  }
  whi += 1;
  
  FPSAvrge = 0;
  
  for (var i = 0; i < FPSArray.length; i++) {
    FPSAvrge += FPSArray[i];
  }
  FPSAvrge /= FPSArray.length;
  
  FPSmooth = FPSAvrge;
  
})